import React from 'react';
import './Contact.css';
import contactLine from './images/contactimage.png';

function Contact() {
  return (
    <>
      <div className='contact-container'>
        <div className='contact-line-image'>
          <img src={contactLine} alt='contact-line' />
        </div>
      </div>
    </>
  );
}

export default Contact;
